// Header.js

import React from "react";
import "./Header.css";

function Header() {
  return (
    <>
      <div className="header">
        <div className="logo">
          <img src="logo192.png" alt="Logo" />
          <span>SecureNet</span>
        </div>
        <div className="navigation">
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </div>
        <div className="user-options">
          <div className="login-signup">
            <a href="#">Login</a>
            <a href="#">Sign Up</a>
          </div>
        </div>
      </div>
    </>
  );
}

export default Header;
